import React from "react";
import NavBar from './NavBar'
import '../src/App.css'


export default class App extends React.Component {
  state = {
    events: []
}

  componentDidMount(){
    fetch(`http://localhost:4000/Events`)
    .then(resp => resp.json())
    .then(events => this.setState({events: events}))
  } 
  render(){
    return (
      <div>
        <NavBar />
      </div>
    );
  }
}
